import React from "react";

const Login = () => {
  return (
    <form>
      <label htmlFor="">帳號</label>
      <input type="String" />
      <label htmlFor="">密碼</label>
      <input type="String" />
      <button>登入</button>
    </form>
  );
};

export default Login;
